import {Cat} from "./component/Cat";

import "./component/Child.css";

const Card = ({ children }) => {
    return (
        <div className="card">
            { children }
        </div>
    );
}

const CatList = () => {
    return (
        <Card>
            <Cat
                size={ 50 }
            />
            <Cat
                size={ 50 }
            />
        </Card>
    );
};

export default CatList;
